import React from 'react';
import { Link } from 'react-router-dom';

function About(props) {
  return (
    <div className="about">
      <div className="containter">
        <div className="about-word">
          <h3>About</h3>
        </div>
        <div className="about-content">
          <h1 className="name">Hi, my name is Noah.</h1>
          <h3 className="introduction">
            I am a UX/UI Designer interested in leveraging technology to make
            people&apos;s lives more efficient and happier. <br />
            <br />I have been previously at{' '}
            <a href="https://modi.luxrobo.com/">Luxrobo</a>,{' '}
            <a href="https://www.giantshoulders.co/">Giant Shoulders</a>, and
            &nbsp;
            <a href="https://www.weddell.co/">Weddell Co.</a> as a designer to
            build products from scratch. I am currently looking for new
            opportunities after studying Industrial Design at{' '}
            <a href="https://www.risd.edu/" target="blank">
              Rhode Island School of Design
            </a>
            .&nbsp;
            <Link to="/AboutMore" className="introduction-view-more">
              View More `&gt;`
            </Link>
            <div className="buttons">
              <Link to="https://www.linkedin.com/in/noahsjung/" target="blank">
                Linkedin
              </Link>
              <Link>Resume</Link>
            </div>
          </h3>
        </div>
      </div>
    </div>
  );
}

export default About;
